//     <AppBar  position="static">
//       <Toolbar >
//         <IconButton
//           size="large"
//           edge="start"
//           color="inherit"
//           aria-label="menu"
//           sx={{ mr: 2 }}
//         >
//           <MenuIcon />
//         </IconButton>
//         <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
//           News
//         </Typography>
//         <Button color="inherit">Login</Button>
//       </Toolbar>
//     </AppBar>
//   </Box>
<div class="navDiv">
    
    <Box class="navColor">
        <Box class="navItemBox1">Our Logo</Box>
        <Box class="navItemBox5">
        <select  class="navItemBox" >
            <option>Infocity Squre</option>
            <option>Trident Collage</option>
            <option>Sai Enclivs</option>
        </select>
            </Box>
        <Box class="navItemBox3">Login</Box>
    </Box>
</div>
  

  )
}

export default Navbar
